pragma solidity 0.6.2;

import "./ProofPointRegistryStorage1.sol";


contract ProofPointRegistry {


    ProofPointRegistryStorage1 eternalStorage1;

    event Issued(address indexed _issuer, bytes indexed _claim);
    event Committed(address indexed _issuer, bytes indexed _claim);
    event Revoked(address indexed _issuer, bytes indexed _claim);

    constructor(address _eternalStorage1) public {
        eternalStorage1 = ProofPointRegistryStorage1(_eternalStorage1);
    }

    function issue(bytes memory _claim) public virtual {

        bytes32 claimKey = keccak256(_claim);
        eternalStorage1.set(msg.sender, claimKey, true);

        emit Issued(msg.sender, _claim);
    }

    function commit(bytes memory _claim) public virtual {

        bytes32 claimKey = keccak256(_claim);
        eternalStorage1.commit(msg.sender, claimKey);

        emit Committed(msg.sender, _claim);
    }

    function revoke(bytes memory _claim) public {

        bytes32 claimKey = keccak256(_claim);
        eternalStorage1.set(msg.sender, claimKey, false);

        emit Revoked(msg.sender, _claim);
    }

    function validate(address _issuer, bytes memory _claim) public view returns(bool) {

        bytes32 claimKey = keccak256(_claim);
        return eternalStorage1.get(_issuer, claimKey);
    }


}

contracts/ProofPointRegistryStorage1.sol.content:
pragma solidity 0.6.2;


contract ProofPointRegistryStorage1 {


    mapping(address=>mapping(bytes32=>bool)) claimsByIssuer;
    mapping(address=>mapping(bytes32=>bool)) comittmentsByIssuer;
    address admin;
    address owner;

    modifier onlyAdmin() {
        if (msg.sender != admin) revert("Not authorized");
        _;
    }

    modifier onlyOwner() {
        if (msg.sender != owner) revert("Not authorized");
        _;
    }

    constructor() public {
        admin = msg.sender;
        owner = msg.sender;
    }

    function getAdmin() public view returns(address) {
        return admin;
    }

    function getOwner() public view returns(address) {
        return owner;
    }

    function setAdmin(address newAdmin) public onlyAdmin {
        admin = newAdmin;
    }

    function setOwner(address newOwner) public onlyAdmin {
        owner = newOwner;
    }

    function set(address _issuer, bytes32 _claim, bool _isValid) public onlyOwner {
        claimsByIssuer[_issuer][_claim] = _isValid;
    }

    function commit(address _issuer, bytes32 _claim) public onlyOwner {
        comittmentsByIssuer[_issuer][_claim] = true;
    }

    function get(address _issuer, bytes32 _claim) public view returns(bool) {

        return comittmentsByIssuer[_issuer][_claim] || claimsByIssuer[_issuer][_claim];
    }
}

